actionConfiguration.body:
() => {
		if (GetStocktakeComparisons.data == null) {
			let ret = []
			return ret
		}
		var ret = []
		for (let i = 0; i < GetStocktakeComparisons.data.data.getStoctakeActualComparison.quantities.length; i ++) {
			let line = GetStocktakeComparisons.data.data.getStoctakeActualComparison.quantities[i]

			let owner = ""
			let ownerId = ""
			if (line.owner != null) {
				owner = line.owner.companyCode
				ownerId = line.owner.id
			}
			let row = {
				"Material": line.material.code,
				"Owner": owner,
				"OwnerId": ownerId,
				"Status": line.status.code,
				"Expected": line.expected,
				"Counted": line.counted,
				"Comment": ""
			}
			ret.push(row)
		}

		storeValue("quantitiesTable", ret)
		return ret
	}

